from datetime import datetime
from enum import IntEnum, auto
from csum import csum

import random

class CMD(IntEnum):
    BUF_RESET = 0
    BUF_SET_ADDR = auto()
    BUF_SET_DATA = auto()
    BUF_CHECKSUM = auto()
    PANEL_REFRESH = auto()
    SYS_RESTART = auto()
    SYS_BOOTLOADER = auto()
    NONE = auto()

# TODO: classify so that dev doesn't need to be passed
# TODO: rename these more better-er
def __send_cmd(dev, cmd, data=None):
    payload = [0] if cmd == CMD.NONE else [0, cmd]
    if data:
        payload.extend(data)
    return dev.write(payload)

def reset_buffer(dev):
    print("resetting buffer")
    return __send_cmd(dev, CMD.BUF_RESET)

def set_addr(dev, addr):
    addr_split = [((addr >> 8*x) & 0xFF) for x in range(3)]
    print(f"setting addr: {addr} ({list(reversed(addr_split))})")
    return __send_cmd(dev, CMD.BUF_SET_ADDR, addr_split)

def write_data(dev, data):
    print(f"writing data ({len(data)} bytes)")
    # the packed data already embeds CMD.BUF_SET_DATA, so use CMD.NONE
    # chunk sends into 8kB, as >12kB is too big
    [__send_cmd(dev, CMD.NONE, chunk) for chunk in chunks(pack_data(data), 8192)]

def checksum(dev, length):
    print(f"running checksum ({length} bytes)")
    length_split = [((length >> 8*x) & 0xFF) for x in range(3)]
    __send_cmd(dev, CMD.BUF_CHECKSUM, length_split)
    res = dev.read(4)
    return (res[0] | res[1] << 8 | res[2] << 16 | res[3] << 24)

def panel_refresh(dev):
    print("refreshing panel")
    return __send_cmd(dev, CMD.PANEL_REFRESH)

def system_restart(dev):
    pass

